// frontend/src/App.js

import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

// Import all page components
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import CustomerListPage from './pages/CustomerListPage';
import CustomerDetailPage from './pages/CustomerDetailPage';
import SupplierListPage from './pages/SupplierListPage';
import SaleListPage from './pages/SaleListPage';
import NewSalePage from './pages/NewSalePage';
import SaleDetailPage from './pages/SaleDetailPage';
import EditSalePage from './pages/EditSalePage';
import ProductListPage from './pages/ProductListPage';
import ExpenseListPage from './pages/ExpenseListPage';
import ProfitLossPage from './pages/ProfitLossPage';
import PurchaseListPage from './pages/PurchaseListPage';
import PurchaseDetailPage from './pages/PurchaseDetailPage';
import EditPurchasePage from './pages/EditPurchasePage';

// Import layout and protected route components
import ProtectedRoute from './components/ProtectedRoute';
import AppLayout from './components/AppLayout';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />

        {/* Protected routes wrapped in the main layout */}
        <Route
          path="/*" // Match all nested routes for the authenticated part of the app
          element={
            <ProtectedRoute>
              <AppLayout>
                <Routes>
                  {/* App routes */}
                  <Route path="dashboard" element={<DashboardPage />} />

                  {/* Customer Routes */}
                  <Route path="customers" element={<CustomerListPage />} />
                  <Route path="customers/:id" element={<CustomerDetailPage />} />
                  
                  {/* Supplier Routes */}
                  <Route path="suppliers" element={<SupplierListPage />} />

                  {/* Sale Routes */}
                  <Route path="sales" element={<SaleListPage />} />
                  <Route path="sales/new" element={<NewSalePage />} />
                  <Route path="sales/:id" element={<SaleDetailPage />} />
                  <Route path="sales/:id/edit" element={<EditSalePage />} />
                  
                  {/* Purchase Routes */}
                  <Route path="purchases" element={<PurchaseListPage />} />
                  <Route path="purchases/:id" element={<PurchaseDetailPage />} />
                  <Route path="purchases/:id/edit" element={<EditPurchasePage />} />

                  {/* Other Routes */}
                  <Route path="inventory" element={<ProductListPage />} />
                  <Route path="expenses" element={<ExpenseListPage />} />
                  <Route path="reports/profit-loss" element={<ProfitLossPage />} />
                  
                  {/* Redirect any other nested path to dashboard */}
                  <Route path="*" element={<Navigate to="/dashboard" />} />
                </Routes>
              </AppLayout>
            </ProtectedRoute>
          }
        />

        {/* A general fallback to the login page */}
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
